import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <body className="page">
        <header className="header">
          <img
            src="<%=require('../images/logo.svg')%>"
            alt="Место"
            className="header__logo"
          />
        </header>
        <main className="content">
          <section className="profile">
            <div className="profile__profile-avatar">
              <img
                src="<%=require('../images/Avatar.svg')%>"
                alt="Кусто"
                className="profile__avatar"
              />
            </div>
            <div className="profile__info">
              <h1 className="profile__title"></h1>
              <button type="button" className="profile__button-change"></button>
              <p className="profile__subtitle"></p>
            </div>
            <button type="button" className="profile__button-add"></button>
          </section>
          <div className="elements">
        <template id="images-card" className="template-card card-template_type_default">
            <div className="element">
                <img className="element__image  element__image_add" alt="Фото" />
                <h3 className="element__title"></h3>
                <button name="elementIconLike" type="button" className="element__icon"></button>
                <div name="elementLikes" className="element__likes"></div>
                <button type="button" className="element__delete">fgfgfgfgfg</button>
            </div>
        </template>
    </div>
        </main>
      </body>
    </div>
  );
}
export default App;


